import React from 'react'
import Button from 'react-bootstrap/Button';


import './Button.css'
const button = (props) => {
  return (
    <div className='text-center'>
      <button className='button text-align-center align-item-center'>
        <a href='/project'>
          {props.text}
        </a>
      </button>
      <Button href="#">Link</Button>
    </div>

  )
}

export default button
